pragma solidity ^0.4.2;

// Import Organization contract
import "./Organization.sol";

// Define Factory contract
contract Factory is Owned {

  // Define organization addresses
  address[] public organizations;

  // Create organization and return organization address
  function createOrganization(address _owner) public returns (bool success) {
    // Create new organization with organization contract
    Organization organization = new Organization(_owner);
    // Push new organization to organizations list
    organizations.push(organization);
    // Return success
    return true;
  }

  // Get organizations
  function getOrganizations() public constant returns (address[]) {
    // Return organizations
    return organizations;
  }

  // Get length of organizations
  function getOrganizationsCount() public constant returns(uint) {
    // Return length of organizations
    return organizations.length;
  }

}
